css:
.go-debug-breakpoint {
  display: inline-block;
  height: 0.8em !important;
  width: 0.8em;
  border-radius: 50%;
  border: 1px solid currentColor;
  color: red;
}
.go-debug-breakpoint-state-valid {
  background-color: currentColor;
}
.go-debug-breakpoint-state-invalid {
  border-color: orange;
  background-color: orange;
}
atom-text-editor::shadow .go-debug-gutter-breakpoint {
  width: 100%;
  display: flex;
  align-items: center;
  cursor: pointer;
}
atom-text-editor::shadow .go-debug-breakpoint {
  display: inline-block;
  height: 0.8em !important;
  width: 0.8em;
  border-radius: 50%;
  border: 1px solid currentColor;
  color: red;
}
atom-text-editor::shadow .go-debug-breakpoint-state-valid {
  background-color: currentColor;
}
atom-text-editor::shadow .go-debug-breakpoint-state-invalid {
  border-color: orange;
  background-color: orange;
}
atom-text-editor::shadow .go-debug-debug-line {
  background: rgba(64, 115, 255, 0.5);
}
.go-debug-panel {
  display: flex;
  border-left: 1px solid #201f1d;
}
.go-debug-panel-root {
  display: flex;
  flex-direction: column;
  flex: 1;
  width: 25em;
  position: relative;
}
.go-debug-panel-resizer {
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
  width: 5px;
  cursor: ew-resize;
}
.go-debug-panel-commands {
  display: flex;
  flex-shrink: 0;
  white-space: nowrap;
  border-bottom: 1px solid #201f1d;
}
.go-debug-panel-commands > .btn {
  flex: 1;
}
button.go-debug-btn-flat {
  border: none;
  border-radius: 0;
  background: none;
  min-height: 3em;
}
.go-debug-panel-args {
  width: 100%;
  margin-bottom: 0.5em;
  background: #252522;
  border: 0;
  border-bottom: 1px solid #201f1d;
  padding: 0.4em;
}
.go-debug-panel-content {
  overflow: auto;
  flex: 1;
}
.go-debug-panel-showoutput {
  flex-shrink: 0;
  text-align: center;
}
.go-debug-panel-stacktrace,
.go-debug-panel-goroutines {
  white-space: nowrap;
  text-overflow: ellipsis;
}
.go-debug-panel-stacktrace > *,
.go-debug-panel-goroutines > * {
  padding: 0.2em 0.5em;
  cursor: pointer;
}
.go-debug-panel-stacktrace > *:nth-child(odd),
.go-debug-panel-goroutines > *:nth-child(odd) {
  background-color: rgba(0, 0, 0, 0.1);
}
.go-debug-panel-stacktrace > *:hover,
.go-debug-panel-goroutines > *:hover {
  background-color: rgba(0, 0, 0, 0.2);
}
.go-debug-panel-variables li {
  padding: 0.1em 0;
}
.go-debug-panel-variables ol {
  overflow: visible;
  margin: 0;
  padding: 0 0.5em;
  white-space: pre-line;
  list-style: none;
}
.go-debug-panel-variables ol ol {
  padding-left: 1.5em;
}
.go-debug-panel-breakpoints > * {
  padding: 0.2em 0.5em 0;
  cursor: pointer;
  white-space: nowrap;
  display: flex;
  align-items: center;
}
.go-debug-panel-breakpoints > * > .icon-x::before {
  height: auto;
  width: auto;
  margin-right: 0.3em;
  flex-shrink: 0;
  font-size: small;
}
.go-debug-panel-breakpoints .go-debug-breakpoint {
  margin-right: 0.2em;
  flex-shrink: 0;
}
.go-debug-output-header {
  display: flex;
  padding-left: 0.5em;
  align-items: center;
}
.go-debug-output-header .text {
  flex: 1;
  margin: 0;
}
.go-debug-output-list {
  max-height: 20em;
  overflow: auto;
  white-space: pre-line;
  padding: 0.2em 0.5em;
}
.go-debug-expandable {
  margin-bottom: 0.5em;
}
.go-debug-expandable-header {
  cursor: pointer;
  border-bottom: 1px solid currentColor;
  padding: 0.2em 0.5em;
  font-weight: bold;
}
.go-debug-expandable-body {
  overflow-x: auto;
}
.go-debug-expandable[data-expanded="false"] .go-debug-expandable-body {
  display: none;
}
.go-debug-toggle {
  display: inline-block;
  cursor: pointer;
  text-align: center;
  width: 1em;
}
.go-debug-toggle::before {
  width: auto;
  height: auto;
  font-size: inherit;
}
.go-debug-toggle.go-debug-toggle-hidden {
  visibility: hidden;
}
.go-debug-busy {
  background-color: rgba(0, 0, 0, 0.1);
}
.go-debug-busy-indicator {
  display: inline-block;
  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  height: 40px;
  width: 6px;
  background-color: currentColor;
  animation: go-debug-busy-animation 1.2s infinite ease-in-out;
}
.go-debug-busy-indicator > .r2 {
  animation-delay: -1.1s;
}
.go-debug-busy-indicator > .r3 {
  animation-delay: -1s;
}
.go-debug-busy-indicator > .r4 {
  animation-delay: -0.9s;
}
.go-debug-busy-indicator > .r5 {
  animation-delay: -0.8s;
}
@keyframes go-debug-busy-animation {
  0%,
  40%,
  100% {
    transform: scaleY(0.4);
  }
  20% {
    transform: scaleY(1);
  }
}
